function Overlay() {
  const overlayStyle = {
    position: "fixed",
    top: 0,
    right: 0,
    bottom: 0,
    left: 0,
    color: "black",
    ziIndex: 1000,
  };

  return <div style={overlayStyle}></div>;
}

export default Overlay;
